@tailwind base;
@tailwind components;
@tailwind utilities;

@layer components {
  .layout {
    @apply w-full mx-auto;
  }

  .layout.full-width {
    @apply max-w-full;
  }

  .layout.centered {
    @apply max-w-7xl;
  }
}
```

