Example 1: Hardcoded Strings
```javascript
function displayWelcomeMessage() {
  console.log("Welcome to our library!");
}
```

Explanation:
In this example, the welcome message is hardcoded in English. This violates i18n best practices because it assumes that all users understand English. If the platform is intended for a global audience, the message should be localized based on the user's preferred language.

Fix:
To make this code i18n compliant, you should externalize the string and use a localization library or framework to fetch the appropriate translation based on the user's locale. Here's an example using the i18next library:

```javascript
import i18n from 'i18next';

function displayWelcomeMessage() {
  console.log(i18n.t('welcomeMessage'));
}
```

In this fix, the hardcoded string is replaced with a call to `i18n.t()`, which fetches the translated string based on the key 'welcomeMessage'. The actual translations would be stored in separate language files, such as `en.json` for English and `fr.json` for French.

